import React, { useEffect } from 'react';
import axios, { AxiosResponse } from 'axios';
import './style.css';
import useCartStore from '../store/cart.store';
import Order from '../Types/Interface/Order.Interface';

interface PaymentProps {
  handleClosePaymentModal: () => void;
  cartlist: Order[];
  totalPrice: number;
}

const Payment: React.FC<PaymentProps> = ({ handleClosePaymentModal, cartlist, totalPrice }) => {
  const { cartList } = useCartStore();

  const POST = async () => {
    const orderList: Order[] = cartList.map(item => ({
      productId: item.productId,
      productName: item.productName,
      orderProductSize: item.productSize,
      orderProductTemperature: item.productTemperature,
      orderProductAmount: item.productAmount,
      orderProductPrice: item.newProductPrice
    }));
    console.log(orderList);
    try {
      await postCartRequest(orderList);
    } catch (error) {
      console.error('Error in POST:', error);
    }
  };

  const DOMAIN = 'http://localhost:8080';
  const API_DOMAIN = `${DOMAIN}/api/v1`;
  const POST_ORDER_PRODUCT_URL = `${API_DOMAIN}/Kiosk/order-product`;

  const postCartRequest = async (orderList: Order[]): Promise<void> => {
    try {
      const result: AxiosResponse<any> = await axios.post(POST_ORDER_PRODUCT_URL, orderList);
      console.log(result.data);
    } catch (error) {
      console.error('Error in postCartRequest:', error);
      throw error;
    }
  };

  const resetCart = (): void => {
    useCartStore.setState({ cartList: [] });
  };

  useEffect(() => {
    const jquery = document.createElement('script');
    jquery.src = 'http://code.jquery.com/jquery-1.12.4.min.js';
    const iamport = document.createElement('script');
    iamport.src = 'http://cdn.iamport.kr/js/iamport.payment-1.1.7.js';
    document.head.appendChild(jquery);
    document.head.appendChild(iamport);
    return () => {
      document.head.removeChild(jquery);
      document.head.removeChild(iamport);
    };
  }, []);

  const requestPay = (): void => {
    const { IMP } = window;
    console.log('IMP 값: ', IMP);
    IMP.init('imp38808434');
    const products: string = cartlist.map(item => `${item.productName} x ${item.productAmount}개 ${item.newProductPrice}원`).join('\n ');
    IMP.request_pay({
      pg: 'kakaopay.TC0ONETIME',
      pay_method: 'card',
      merchant_uid: new Date().getTime(),
      name: products,
      amount: totalPrice
    }, async (rsp) => {
      try {
        const { data }: AxiosResponse<any> = await axios.post(`http://localhost:8080/verifyIamport/kakao/${rsp.imp_uid}`);
        if (rsp.paid_amount === data.response.amount) {
          alert('결제 성공');
          POST();
          resetCart();
          handleClosePaymentModal();
          console.log(rsp.paid_amount);
          console.log(data.response.amount);
        } else {
          alert('결제 실패1');
          console.log(rsp.paid_amount);
          console.log(data.response.amount);
        }
      } catch (error) {
        console.error('Error while verifying payment:', error);
        alert('결제 실패2');
      }
    });
  };

  const requestPay2 = (): void => {
    const { IMP } = window;
    IMP.init('imp38808434');
    IMP.request_pay({
      pg: 'tosspay.tosstest',
      pay_method: 'card',
      merchant_uid: new Date().getTime(),
      name: '테스트 상품',
      amount: 1004
    }, async (rsp) => {
      try {
        const { data }: AxiosResponse<any> = await axios.post(`http://localhost:8080/verifyIamport/toss/${rsp.imp_uid}`);
        if (rsp.paid_amount === data.response.amount) {
          alert('결제 성공');
        } else {
          alert('결제 실패');
        }
      } catch (error) {
        console.error('Error while verifying payment:', error);
        alert('결제 실패');
      }
    });
  };

  const handleCancel = (): void => {
    handleClosePaymentModal();
  };

  return (
    <>
      <div className="pay">
        <div className="payment-option" onClick={requestPay}>
          <img src="https://img1.daumcdn.net/thumb/R1280x0/?scode=mtistory2&fname=https%3A%2F%2Fblog.kakaocdn.net%2Fdn%2FcEaPmw%2FbtrcIUODymI%2FEBvA7nx7wVTcdLIrgiVsJK%2Fimg.jpg" alt="카카오 로고" />
          <div>카카오페이</div>
        </div>
        <div className="payment-option" onClick={requestPay2}>
          <img src="https://framerusercontent.com/images/EhEElRcoy4v5Y9uyUj3XkTWg.jpg" alt="토스 로고" />
          <div>토스페이</div>
        </div>
        <div className="cancel-button" onClick={handleCancel}>취소</div>
      </div>
    </>
  );
};

export default Payment;
